import { Row, Col, Layout } from 'antd';
import 'antd/dist/antd.css';
import './style-footer.css';

function Footerr(props) {
  const { Footer } = Layout;
  return (
    <>
      <Layout className="layout">
        <Footer style={{ textAlign: 'center' }}>
          {/* <div className="icons"> */}
          <i className="fa fa-facebook icons" aria-hidden="true"></i>
          <i className="fa fa-twitter" aria-hidden="true"></i>
          <i className="fa fa-linkedin" aria-hidden="true"></i>
          <i className="fa fa-envelope" aria-hidden="true"></i>
          <p className="p1">Home . Products . About . Contact Us</p>
          <p className="p2">8000-150, faro, PORTUGAL</p>
          <p className="p3">© 2020 BADIAVENTURES</p>
          {/* </div> */}
        </Footer>
      </Layout>
      {/* <Row style={{ paddingTop: `75px` }} className="footer">
        <Col
          xs={{ span: 14, offset: 7 }}
          sm={{ span: 10, offset: 7 }}
          md={{ span: 8, offset: 9 }}
          lg={{ span: 8, offset: 9 }}
        >
          <div className="footer-pos">
            <div className="icons">
              <i className="fa fa-facebook" aria-hidden="true"></i>
              <i className="fa fa-twitter" aria-hidden="true"></i>
              <i className="fa fa-linkedin" aria-hidden="true"></i>
              <i className="fa fa-envelope" aria-hidden="true"></i>
              <p className="p1">Home . Products . About . Contact Us</p>
              <p className="p2">8000-150, faro, PORTUGAL</p>
              <p className="p3">© 2020 BADIAVENTURES</p>
            </div>
          </div>
        </Col>
      </Row> */}
    </>
  );
}

export default Footerr;
